-- ----------------------------
-- Function structure for nm_bulan
-- ----------------------------
DROP FUNCTION IF EXISTS `nm_bulan`;
delimiter ;;
CREATE FUNCTION `nm_bulan`(i INT(2))
 RETURNS varchar(128) CHARSET latin1
  DETERMINISTIC
BEGIN 
  DECLARE s VARCHAR(128); 
	CASE i
	WHEN 1 THEN
		SET s = 'Januari';
	WHEN 2 THEN
		SET s = 'Februari';
	WHEN 3 THEN
		SET s = 'Maret';
	WHEN 4 THEN
		SET s = 'April';
	WHEN 5 THEN
		SET s = 'Mei';
	WHEN 6 THEN
		SET s = 'Juni';
	WHEN 7 THEN
		SET s = 'Juli';
	WHEN 8 THEN
		SET s = 'Agustus';
	WHEN 9 THEN
		SET s = 'September';
	WHEN 10 THEN
		SET s = 'Oktober';
	WHEN 11 THEN
		SET s = 'November';
	WHEN 12 THEN
		SET s = 'Desember';
	ELSE
		SET s = 'Januari';
	END CASE;

  RETURN s; 
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
